import './LandingPage.css';
import Register from '../UserMgmt/Registeration'
import SignIn from '../UserMgmt/Registeration'
import {useState} from 'react'

function LandingPage() {
    const ChangeState = (StateValue) => {
        setState(StateValue);
    }
    const Showsignup=()=>
    {
        setState("Register");
    } 
    return (
        <div>
            <div class="header">
                <div class="header-left-component">
                    <div>
                        <label>Welcome to landing page</label>
                        </div>
                </div>  
                <div class="header-right-component">
                    <div class="header-right-component-right">
                    <div class="dvSignIn">
                        <label><a href="/">Sign In</a></label>
                    </div>
                    { State == "Registerbtn" &&
                            <div class="dvSignUp">
                                <label><a href="/" onClick={Showsignup}>Sign Up</a></label>
                            </div>
                    }
                    </div>                  
                </div>
            </div>
            <div class="content">
                {State == "Register" &&
                    <Register></Register>
                }
            </div>           
        </div>
    );
}
export default LandingPage;
